function getTimeDiffInMinutes({ date }) {
    const now = new Date();
    const targetDate = new Date(date);
    const diffInSeconds = (targetDate.getTime() - now.getTime()) / 1000;
    const diffInMinutes = Math.abs(Math.round(diffInSeconds / 60));
    return diffInMinutes;
}
